import matplotlib.pyplot as plt
import numpy as np
import pandas as pd
def plot_default(map, ylab='Reward' ):
    name = ['DQN-OD', '全部开启', '全部关闭']
    plt.plot(map[0], marker='o', label= name[0])
    plt.plot(map[1], marker='o', label =name[1])
    plt.plot(map[2], marker='o', label=name[2])
    plt.xlabel('场景')
    plt.ylabel(ylab)
    plt.xticks([0, 1, 2, 3], ['场景1', '场景2', '场景3', '场景4'])
    plt.legend()
    plt.rcParams['font.sans-serif'] = ['SimHei']  # 使用黑体字体
    plt.rcParams['axes.unicode_minus'] = False  # 正确显示负号
    plt.savefig(ylab+'.svg', format='svg')
    plt.show()

def plot_default(map, map_list=None, a=None, ylab='Reward' ):

    ## 黄色：能耗 绿色：负载 蓝色：延迟
    i = 0
    # 创建图表和第一个y轴
    fig, ax1 = plt.subplots()

    # 绘制第一个y轴的数据
    color = 'tab:red'
    ax1.set_ylabel(ylab)
    ax1.set_xlabel('时隙')
    ax1.tick_params(axis='y')
    s = "ygb"
    name = ['DQN-OD', '全部开启', '归一化能耗' ]
    # 创建第二个y轴，共享相同的x轴
      # 创建次y轴
    if (map_list != None):
        map_list.append(map)
        for mapi in map_list:
            ax1.plot(np.arange(len(mapi)), mapi, color=s[i], label=name[i])
            ax1.legend()
            i += 1
    else:
        ax1.plot(np.arange(len(map)), map)
    if (a != None):
        ax2 = ax1.twinx()
        ax2.set_ylabel('处于工作状态的移动服务器总数')  # 设置次y轴的标签
        ax2.plot(np.arange(len(a)), a, color=color)
        ax2.tick_params(axis='y')
    plt.rcParams['font.sans-serif'] = ['SimHei']  # 使用黑体字体
    plt.rcParams['axes.unicode_minus'] = False  # 正确显示负号
    plt.savefig('对比全部开启' + '.svg', format='svg')
    plt.show()
def min_max_scaler(data,max_value,min_value):
    return [(x - min_value) / (max_value - min_value) for x in data]
